import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Header from './partials/Header';


class App extends Component {
  render() {
    return (
      <div className="App">
        <Header/>
        <h2>Hi</h2>
      </div>
    );
  }
}

export default App;
